text:
{'text': 'NUS Museum is a university museum focused on Asian art and culture, with a mix of historical and contemporary works. The space is nothing grand but large enough to house a good range of exhibits, and very comfortable — calm, quiet, and peaceful when I visited, perfect for a slow, reflective visit.

The permanent collection is well-curated, and they currently have two excellent exhibitions: Fistful of Colours: Moments of Chinese Cosmopolitanism and Unfettered Brush: The Art and Writings of Tan Joo Jong — both worth checking out.

Overall, a hidden gem if you enjoy art and want a quiet museum experience.', 'languageCode': 'en'}

